INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(1, 'Spaghetti Bolognese', 0, 0, 0, '1) Die Zwiebel schälen und klein würfelig schneiden. Den Knoblauch schälen und in kleine Stücke hacken. Die Karotten waschen, schälen die harten Enden vom Stiel schneiden, den Rest sehr klein schneiden. Die Petersilie waschen, ausschütteln und fein hacken.\r\n2) Danach reichlich Salz-Wasser aufkochen die Nudeln darin weichkochen (=al dente) und anschließend durch ein Sieb abgießen.\r\n3) In der Zwischenzeit das Öl in einem Topf erhitzen und darin Knoblauch sowie den Zwiebel darin 4 Minuten dünsten. Die Karotten hinzufügen und weitere 2 Minuten mit dünsten.\r\n4) Nun das Faschierte beimengen und kurz durchbraten. Tomatensauce, Oregano und Rotwein hinzufügen und die Flüssigkeit etwas reduzieren lassen. Den Deckel auf den Topf und bei kleiner Hitze gut 40 Minuten köcheln lassen.\r\n5) Zum Schluss das Tomatenmark unterrühren und die Sauce mit Salz, Pfeffer und der Petersilie abschmecken.\r\n6) Die gekochten Spagetti appetitlich auf Tellern anrichten, die Sauce darüber geben und mit ein paar frischen Basilikumblättern garnieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(2, 'Spiegeleier', 1, 0, 1, '1) Die Eier in einer Tasse aufschlagen, den Käse in Streifen schneiden, in einer Pfanne das Olivenöl erhitzen und die Eier in die Pfanne geben.\r\n2) Den Käse auf dem Eiklar verteilen und zugedeckt fertig braten bis der Käse geschmolzen und der Dotter etwas gestockt ist.\r\n3) Die Spiegeleier auf einen Teller gleiten lassen und mit Oregano bestreut servieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(3, 'Wiener Schnitzel', 0, 0, 0, '1) Schnitzel zwischen Frischhaltefolie behutsam klopfen. Fleisch beidseitig salzen, in Mehl wenden, abklopfen, durch die Eier ziehen und in den Bröseln wenden.\r\n2) Schnitzel ca. 2 Finger hoch Backfett goldgelb backen. Während des Backens die Pfanne ein wenig rütteln, damit die Schnitzel gleichmäßig goldbraun werden. Schnitzel herausheben, auf Küchenpapier abtropfen lassen.\r\n3) Zitrone in Spalten schneiden und die fertigen Wiener Schnitzel mit Zitronenspalten garnieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(4, 'Kaiserschmarren', 1, 0, 0, '1) Für diesen köstlichen Kaiserschmarrn zuerst in einer Schüssel Mehl, Zucker, Salz und Dotter mit der Milch zu einem glatten, dickflüssigen Teig verrühren.\r\n2) In einer anderen Schüssel die Eiklar zu einem steifen Schnee schlagen und danach unter den dickflüssigen Teig heben.\r\n3) Die Butter in einer großen, flachen Pfanne aufschäumen lassen, den Teig langsam eingießen, und auf beiden Seiten anbacken.\r\n4) Anschließend die Pfanne in ein vorgeheiztes Backrohr bei mäßiger Hitze (Heißluft ca. 180°C) für 10-12 Min. fertig backen - bis der Kaiserschmarren leicht goldbraun ist.\r\n5) Danach die Pfanne aus dem Backrohr nehmen und den fertigen Teig mit zwei Gabeln in unregelmäßige Stücke zerreißen.\r\n6) Nun die Rosinen hinzufügen, gut verrühren und die Pfanne nochmals für ca. 1 Minute in den noch heißen Backofen.\r\n7) Den Schmarren auf Tellern anrichten, mit Zucker bestreuen und mit beliebigem \r\nKompott oder auch Apfelmus servieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(5, 'Wurstnudeln', 0, 0, 0, '1) Die Hörnchen laut Packungsangabe kochen. Zwiebel schälen und würfeln. Wurst in kleine Würfel schneiden. Öl erhitzen und Zwiebel anbraten. Wurst hinzufügen und anbraten.\r\n2) Die Hörnchen abseihen und dazugeben. Den Schnittlauch waschen und fein schneiden. Mit Salz und Pfeffer würzen und mit Schnittlauch bestreuen.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(6, 'Palatschinken', 1, 0, 0, '1) Für die Palatschinken zuerst Mehl, Milch, Eier, Salz mit dem Schneebesen in einer Schüessel glatt rühren. Ca. 10 Min. stehen lassen, dadurch wird der Teig etwas dicker und danach nochmals gut durchrühren.\r\n2) Sollte der Palatschinkenteig zu dick sein, mit etwas Mineral oder Soda verdünnen.\r\n3) In einer beschichteten Pfanne einen Schuss Öl erhitzen (das Öl sollte ganz heiß sein, dann gelingt die erste Palatschinke sofort). Dann etwas Teig (mit einem Schöpfer) in die heiße Pfanne hineingegeben. Die Pfanne dabei immer wieder schwenken, sodass der Boden gleichmäßig dünn mit Teig bedeckt ist.\r\n4) Mit dem Pfannenwender die Palatschinke mehrmals wenden und von beiden Seiten goldgelb ausbacken.\r\n5) Die Fertig gebackenen Palatschinken halten sie im Backofen bei ca. 60 Grad warm.\r\n6) Mit beliebigen Zutaten (Marmelade, Nutella, Schinken & Käse etc.) die Palatschinken bestreichen und zusammenrollen.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(7, 'Gemüsesuppe', 1, 0, 1, '1) Für diese einfache Gemüsesuppe das Gemüse waschen, putzen und in kleine Stücke schneiden.\r\n2) Fett in einem Topf zerlassen und die Zwiebel darin dünsten, dann das Gemüse hinzugeben.\r\n3) Mit dem Wasser ablöschen und ca. 15-20 Minuten (je nach Gemüseart) garen lassen - nach Belieben mit Salz, Pfeffer und eventuell Muskat abschmecken.\r\n4) Mit einem Esslöffel Sauerrahm (in der Mitte des Tellers/Schüssel) servieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(8, 'Rührei', 1, 0, 1, '1) Eier aufschlagen und mit Milch verquirlen. Mit Salz würzen. Die Margarine in einer Pfanne scmelzen. Danach die Eiermischung auf einmal in die Pfanne gießen und einen Moment braten.\r\n2) Mit einem Küchenfreund das Ei von außen nach innen schieben. Zum Schluss den Schnittlauch darüber schneiden.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(9, 'Pizzateig', 1, 1, 0, '	1) Für den Pizzateig wird zuerst das Mehl in eine Schüssel gesiebt.\r\n2) Das Wasser (hier kann man auch noch einen Schuss Milch hinzufügen) leicht erwärmen und in einer Schüssel mit dem Salz, einer Prise Zucker, der Hefe und dem Öl gut verrühren.\r\n3) Nun die Flüssigkeit über das Mehl gießen und gut verkneten - zuerst mit dem Knethaken eines Mixers und danach mit der Hand - so wird der Teig glatt und geschmeidig. Sollte der Teig kleben, einfach mehr Mehl zufügen.\r\n4) Den fertigen Teig zudecken (mit einem Küchentuch) und für ca. 30-40 Minuten an einem warmen Ort ruhen lassen - dadurch verdoppelt er sein Volumen.\r\n5) Nun den Pizzateig auf einer behmehlten Arbeitsfläche ausrollen und nach Belieben belegen - der Teig braucht im Ofen je nach Hitze und Belag ca. 15-25 Minuten bei 250 Grad', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(10, 'Milchreis', 1, 0, 1, '	1) Milch, Salz und Vanillezucker in einem Topf vermengen und bei bei niedriger Hitze kurz aufkochen lassen.\r\n2) Anschließend den Reis zur Milch hinzufügen und alles nochmal aufkochen lassen. Danach bei niedriger Hitze den Milchreis ca. 20 Min. garen lassen bis der Reis weich ist - stets nebenbei rühren, damit nichts anbrennt.\r\n3) Je nach Geschmack mit Zucker oder Zimt bestreuen und wer es fruchtig mag mit Früchten der Saison garnieren.', );
INSERT INTO `tab_rezepte` (`ID`, `Rezeptname`, `vegetarisch`, `vegan`, `glutenfrei`, `Zubereitung`, `Bild`) VALUES
(11, 'Salzkartoffeln', 1, 1, 1, '1) Die Kartoffeln waschen und schälen. In einem weiten Topf Wasser zum Kochen bringen und gut salzen. Nun die geschälten Kartoffeln vierteln bzw. würfeln.\r\n2) Die Kartoffeln in das Salzwasser geben (sie sollten mit dem Wasser bedeckt sein) und bei mittlerer Hitze für ca. 15-20 Min. weich kochen.\r\n3) Nach dem kochen abseihen und servieren.', );

